                    <div className="Login">
                        <header className="Login">
                            <div style="width: 100px; height: 100px;">
                                <img src="/home/divyaksh/Documents/Coding/react/voi-notes/src/assets/images/lock.svg" />
                            </div>
                            <p> Login </p>
                            <form action="#" method="POST">
                                <input type="text" name="user" />
                            </form>
                        </header>
                    </div>
                </div>
            </div>
        )
    }
}

export default Login;
